import React from "react";

import Button from "./Button";

import style from "./ErrorMessage.module.css";

const ErrorMessage = () => {
  return (
    <div className={style.back}>
      <div></div>
      <div>
        <Button>Close</Button>
      </div>
    </div>
  )
};

export default ErrorMessage;
